import React from "react";

function Arduino() {
  return (
    <div style={{ padding: "20px" }}>
      <h1>Arduino</h1>
      <p>
        Encuentra kits, placas y accesorios compatibles con Arduino.
      </p>
    </div>
  );
}

export default Arduino;
